// SongResults.js
import React from 'react';

function SongResults({ songs }) {
  return (
    <div>
      <h2>Song Results:</h2>
      <ul>
        {songs.map((song) => (
          <li key={song._id}>
            <strong>Title:</strong> {song.name}, <strong>Artist:</strong> {song.artist}, <strong>Album:</strong>{' '}
            {song.album}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default SongResults;
